import Card from '../UI/Card';
import classes from './Cart.module.css';
import CartItem from './CartItem';

const Cart = (props) => {
  const cartItems = useSelecter(state => state.cart.items);
  return (
    <Card className={classes.cart}>
      <h2>Your Shopping Cart</h2>
      <ul>
        {cartItems.map(item => {
          return (
            <CartItem
              item={item}
            />
          )
        })}
      </ul>
    </Card>
  );
};

export default Cart;
